function [prob_block] = integrate(x,y,pause_prob, m_min, c_min, m_max, c_max, x_min, x_max)
    ymin = m_min*x + c_min;
    ymax = m_max*x + c_max;
%     display(ymin);
%     display(ymax);
    fxy(x,y) = (pause_prob + (1-pause_prob)*(-6/5^3*y^2 + 6/5^2*y)*(-6/5^3*x^2 + 6/5^2*x));
   
    dy = int(fxy, y);
    dy1 = subs(dy, y, ymin);
    dy2 = subs(dy, y, ymax);
  
    fy = dy2 - dy1;
    
    dydx(x) = fy;
    
    dx = int(dydx);

    dx1 = subs(dx, x, x_min);
    dx2 = subs(dx, x, x_max);
    
    prob_block = dx2-dx1;
    
%     display(prob_block);

end

